import React from "react";
import TextField from "@mui/material/TextField";
import MenuItem from "@mui/material/MenuItem";

const currencies = [
  {
    value: "USD",
    label: "$",
  },
  {
    value: "EUR",
    label: "€",
  },
  {
    value: "BTC",
    label: "฿",
  },
  {
    value: "JPY",
    label: "¥",
  },
];

const Wallet = () => {
  return (
    <div>
      <h1>Wallet</h1>
      <TextField
        id="outlined-basic"
        label="Wallet name"
        variant="outlined"
        placeholder="Your wallet name"
      />
    </div>
  );
};

export default Wallet;
